import React from 'react'
import { useState } from 'react';
import './SignUp.css'
import { Link } from 'react-router-dom'



export default function SignUp() {

    //-------Show New Password------//

    const [passwordType, setPasswordType] = useState("password");
    const [passwordInput, setPasswordInput] = useState("");
    const handlePasswordChange = (evnt) => {
        setPasswordInput(evnt.target.value);
    }




    const togglePassword = (e) => {
        e.preventDefault()


        if (passwordType === "password") {
            setPasswordType("text")
            return;
        }
        setPasswordType("password")
    }

    //----------Controle Reffreshing page---------// 

    const signUp = (e) => {
        e.preventDefault()
        try {
        } catch (error) {
            console.log(error.message)
        }
    }




    return (
        <div>
            <div className='container'>
                <div className="row">
                    <div className="col md-6 sm-12">
                        <div className="signUpCard  ">
                            <div className="card " style={{ width: '20rem', height: "35rem", }}>
                                <div class="card-body">
                                    <h3 class="card-title text-center fw-bold mt-3">Sign Up</h3>
                                    <form>
                                        <div classname="form-group mt-3">
                                            <label for="exampleInputEmail1" className="form-label mb-0">
                                                Email
                                            </label>
                                            {/* <div className="input-group-addon"> */}
                                            {/* <i classname="bi bi-person-fill"></i> */}

                                            {/* {/* <i className="bi bi-envelope-fill"></i> */}
                                            <input type="email" placeholder='Type your email ' className="form-control mt-0   userName " required />
                                            {/* </div> */}
                                        </div>
                                        <div class="mt-3">
                                            <label for="exampleInputname" className="form-label mb-0">
                                                Username </label>
                                            {/* <div className="input-group-addon"> */}
                                            {/* <i className="bi bi-person-fill inline "></i> */}
                                            {/* </div> */}
                                            <input type="text" className="form-control mt-0 userName " placeholder='Type your username' required />
                                        </div>
                                        <div className="mt-3">
                                            <label for="exampleInputPassword1" className="form-label mb-0" >Password</label>
                                            <input type="password" className="form-control password" id='password' placeholder='Password' />
                                            <i class="bi bi-eye-slash" className='ayeIcon' id="togglePassword"></i>
                                        </div>
                                        <div className="mt-3">
                                            <label for="exampleInputPassword1" className="form-label mb-0" >Conferm Password</label>
                                            <input type={passwordType} onChange={handlePasswordChange} value={passwordInput} name="password" className="form-control password" placeholder="Conferm Password" />
                                            <div >
                                                <input type="checkbox" name="ShowPassword" id="ShowPassword" className='m-2' onClick={togglePassword} />Show Password
                                            </div>
                                        </div>
                                        <div className='dateOfBirth'>
                        

                                        </div>
                                        <div className='mt-3'>
                                            <div class="form-check form-check-inline">
                                                <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio1" value="option1" />
                                                <label class="form-check-label" for="inlineRadio1">Male</label>
                                            </div>

                                            <div class="form-check form-check-inline">
                                                <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio2" value="option2" />
                                                <label class="form-check-label" for="inlineRadio2">Female</label>
                                            </div>

                                            <div class="form-check form-check-inline">
                                                <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio3" value="option3" />
                                                <label class="form-check-label" for="inlineRadio3">Other</label>
                                            </div>
                                            <div className=''>
                                                <button type="signUp" className="btn logInBtn  mt-3 w-100 text-light" onClick={signUp}>Sign Up</button>
                                            </div>
                                        </div>
                                    </form>
                                    <div className='text-center Login-link mt-3'>
                                        <Link to='/LogIn' className='Login-link'>Login</Link>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div >
        </div >


    )
}
